import React, { useState, useEffect } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Typography,
  Autocomplete,
  TextField,
  List,
  ListItem,
  ListItemText,
  IconButton,
} from '@mui/material';
import { useAuth } from '../../contexts/AuthContext';
import './AssignPathologiesDialog.css';

const AssignPathologiesDialog = ({ open, onClose, patient, onAssign }) => {
  const { user } = useAuth();
  const [allPathologies, setAllPathologies] = useState([]);
  const [assignedPathologies, setAssignedPathologies] = useState([]);
  const [selectedPathologies, setSelectedPathologies] = useState([]);

  useEffect(() => {
    const fetchAllPathologies = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/pathologies', {
          method: 'GET',
          credentials: 'include',
        });
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();
        setAllPathologies(data);
      } catch (error) {
        console.error('Error fetching pathologies:', error);
      }
    };

    const fetchAssignedPathologies = async () => {
      try {
        const response = await fetch(`http://localhost:5000/api/patient_pathology/${patient.uuid}`, {
          method: 'GET',
          credentials: 'include',
        });
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();
        setAssignedPathologies(data);
      } catch (error) {
        console.error('Error fetching assigned pathologies:', error);
      }
    };

    if (open) {
      fetchAllPathologies();
      fetchAssignedPathologies();
    }
  }, [open, patient.uuid]);

  const handleAssign = async () => {
    try {
      const response = await fetch(`http://localhost:5000/api/patient_pathology`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        credentials: 'include',
        body: JSON.stringify({ patient_uuid: patient.uuid, pathology_ids: selectedPathologies.map((p) => p.id) }),
      });

      if (!response.ok) {
        throw new Error('Network response was not ok');
      }

      onAssign();
      onClose();
    } catch (error) {
      console.error('Error assigning pathologies:', error);
    }
  };

  const handleRemove = async (pathologyId) => {
    try {
      const response = await fetch(`http://localhost:5000/api/patient_pathology`, {
        method: 'DELETE',
        headers: {
          'Content-Type': 'application/json',
        },
        credentials: 'include',
        body: JSON.stringify({ patient_uuid: patient.uuid, pathology_id: pathologyId }),
      });

      if (!response.ok) {
        throw new Error('Network response was not ok');
      }

      setAssignedPathologies((prev) => prev.filter((p) => p.id !== pathologyId));
      onAssign();
    } catch (error) {
      console.error('Error removing pathology:', error);
    }
  };

  return (
    <Dialog open={open} onClose={onClose} fullWidth maxWidth="sm">
      <DialogTitle>Assegna Patologie a {patient.nominativo}</DialogTitle>
      <DialogContent>
        <Typography>Seleziona una o pi√π patologie da assegnare a questo paziente.</Typography>
        <Autocomplete
          multiple
          options={allPathologies}
          getOptionLabel={(option) => option.name}
          value={selectedPathologies}
          onChange={(event, newValue) => {
            setSelectedPathologies(newValue);
          }}
          renderInput={(params) => <TextField {...params} label="Patologie" />}
        />
        <Typography variant="h6" style={{ marginTop: '20px' }}>
          Patologie Assegnate
        </Typography>
        <List>
          {assignedPathologies.map((pathology) => (
            <ListItem key={pathology.id}>
              <ListItemText primary={pathology.name} />
              <IconButton edge="end" onClick={() => handleRemove(pathology.id)}>
                <Typography color="secondary">RIMUOVI</Typography>
              </IconButton>
            </ListItem>
          ))}
        </List>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} color="primary">
          Annulla
        </Button>
        <Button onClick={handleAssign} color="primary">
          Conferma
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default AssignPathologiesDialog;
